    October 1981",nt"tracking_summary": {ntt"total": 1,ntt"recent": 1nt},nt"groups":
    [],nt"relationships_as_subject": [],nt"revision_timestamp": "2013-03-15T21:27:38.692580",nt"name":
    "streamflow-gain-loss-in-the-republican-river-basin-nebraska-october-1981",nt"isopen":
    false,nt"url": null,nt"notes": "This arc and point data set contains streamflow-measurement
    sites and reaches indicating streamflow gain or loss under base-flow conditions
    along the Republican River and tributaries in Nebraska during October 19 to 20,
    1981 (Engel and others, 1984). The streamflow measurements were made to obtain data
    on ground-water/surface-water interaction. Flow was observed visually to be zero,
    was measured, or was estimated at 105 sites. The measurements were made on the main
    stem of the Republican River and all flowing tributaries that enter the Republican
    River between Muddy Creek in western Furnas County and Harlan County Reservoir in
    the Nebraska part of the Republican River Basin. Tributaries were followed upstream
    until the first road crossing where zero flow was encountered. For selected streams,
    points of zero flow upstream of the first zero flow site were also checked. Streamflow
    gain or loss for each stream reach was calculated by subtracting the streamflow
    values measured at the upstream end of the reach and values for contributing tributaries
    from the downstream value. The data obtained reflected base-flow conditions suitable
    for estimating streamflow gains and losses for stream reaches between sites. This
    digital data set was created by manually splitting the lines from a 1:250,000 hydrography
    data set (Soenksen and others, 1999) at every streamflow measurement site. Each
    set of stream segments between measurement sites was assigned a unique reach number.",nt"license_title":
